        public IActionResult Index()
        {
            var initialPost = _feed.GetRange(0, 5);
            return View(initialPost);
 
        }

        [HttpGet]
        public IActionResult GetMorePosts(int skip)
        {
            int take = 5;

            if (skip < 0)
            {
                skip = 0;
            }
            else if (skip >= _feed.Count)
            {
                return Json(new List<SocialFeed>());
            }

            int remainingPosts = _feed.Count - skip;

            var nextPagePosts = _feed.Skip(skip).Take(Math.Min(take, remainingPosts)).ToList();
            return Json(nextPagePosts);
        }



